import AddUser from "./components/Users/AddUser";

const saveNewUserHandler = (input) => {
  const inputWithID = { ...input, id: Math.random().toString() };
  inputWithID.map((data) => <h2>{data}</h2>);
};

function App() {
  return (
    <div>
      <AddUser saveNewUser={saveNewUserHandler} />
    </div>
  );
}

export default App;
